import { Grid } from '@material-ui/core';
import React from 'react';

function calc() {
	return (
		<Grid
			item
			container
			alignItems="end"
			justify="center"
			style={{ background: 'red' }}
		>
			Calc
		</Grid>
	);
}

export default calc;
